import { IoMenuSharp } from "react-icons/io5";

const Nav = () => {
  return (
      <div className ='fixed z-[999] max-w-screen-2xl mx-auto px-5 sm:px-10 py-5 flex items-center justify-between text-white'>  
      <div className='logo'> 
      
      </div>
      
  <span className='sm:hidden'> 
  <IoMenuSharp />
  </span>
  <div className='links hidden sm:flex '>
  {["Home", "About", "Pricing", "Contact"].map((item, index)=> <a key={index} className="text-sm font-light font-sans"> {item}</a>)}
  </div>
  </div>
   
   
  )
}

export default Nav
